import './card.styles.css';

const Card = ({ Title, Year, Poster }) => {
  const title = Title;
  const year = Year;
  const img = Poster;

  return (
    <div className='card-container'>
      <img
        alt={`monster ${title}`}
        src={`https://robohash.org/${1}?set=set2&size=180x180`}
      />
      <h2>{title}</h2>
      <p>{year}</p>
    </div>
  );
};

export default Card;
